interface IMenu{
    title: string,
    enabled: boolean
}

let menuItems : IMenu[] = [
    {
        title: 'Главная',
        enabled: true
    },
    {   
        title: 'Мои курсовые',
        enabled: false
    },
    {
        title: 'Свободные курсовые',
        enabled: false
    },
    {
        title: 'Требуют рецензии',
        enabled: false
    }
]

export default menuItems;
